$(document).ready(function e(){$("#form-check").on("submit",function e(t){t.preventDefault();var n=t.currentTarget.action;$.ajax({type:"POST",url:n,dataType:"json",data:$(this).serialize(),success:function e(t){$("#check-results").val(t.result);$("#check-results").parents(".row").removeClass("d-none");if(t.status===true){$("#result-new-modal").find('input[name="_csrf"]').val(t.csrfToken);$("#check-results").parents(".row").addClass("d-none");$("#result-new-modal").find(".alert").removeClass("d-none").empty().append(t.message);$("#result-new-modal").modal("show")}}})})});$(document).ready(function e(){$("#form-new-result").on("submit",function e(t){t.preventDefault();var n=t.currentTarget.action;$.ajax({type:"POST",url:n,dataType:"json",data:$(this).serialize(),success:function e(t){window.location=t.location}})})});